// root
import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";
import PropTypes from "prop-types";
const Portfolio = ({ Component }) => {
  return (
    <>
      <Head>
        <title>PortFolio</title>
        <link
          rel="stylesheet"
          href="https://cdnjs.cloudflare.com/ajax/libs/antd/3.26.11/antd.css"
        ></link>
        <script src="https://cdnjs.cloudflare.com/ajax/libs/antd/3.26.11/antd.js"></script>
      </Head>
      <AppLayout>
        <Component></Component>
      </AppLayout>
    </>
  );
};

Portfolio.propTypes = {
  Component: PropTypes.node // JSX 에 들어가는 모든것(문자열,컴포넌트,태그,숫자 등)
};

export default Portfolio;
